/original/MV5BODE5OWVlZjYtZjVjMC00NzI5LTk5YWUtZGQyM2U4YmJjMDRjXkEyXkFqcGdeQXVyMjQwMDg0Ng@@._V1_Ratio0.7273_AL_.jpg","name":"Iain Tucker","asCharacter":"Ahole Teenager"},{"id":"nm6881239","image":"https://imdb-api.com/images/original/MV5BNzNlYjBmZDItZGQyZC00ZmUxLTkwMzgtMjU4ZjI0MDkzOTU4XkEyXkFqcGdeQXVyNjUxMjc1OTM@._V1_Ratio2.0000_AL_.jpg","name":"Sean Michael Weber","asCharacter":"Paramedic"},{"id":"nm5902264","image":"https://imdb-api.com/images/original/MV5BYzU1OTcyMjYtYWJlNi00MWY5LTllODctNDUxNzM3YmVjODA0XkEyXkFqcGdeQXVyNzg3NTExNDY@._V1_Ratio1.0000_AL_.jpg","name":"Drew Scheid","asCharacter":"Ted"}]', 'teenager, based on young adult novel, schizophrenia, hallucination, hospital', NULL, '0');
