INSERT INTO public.movies (id, title, image, rating, "views", "year", runtimemins, plot, genres, countries, contentrating, imdbrating, directors, directorlist, stars, actorlist, keywordlist, images, votes) VALUES('tt0406375', 'Zathura: A Space Adventure', 'https://imdb-api.com/images/original/MV5BMDc1NzM1OTgtOGYxMS00ZWE1LWEzZWMtNWEyOTI2NDJjOTU2XkEyXkFqcGdeQXVyNjQzNzA2NjM@._V1_Ratio0.6791_AL_.jpg', '0', '0', '2005', '101', 'An old and forgotten game develops magical powers in this fantasy for the whole family. Twelve-year-old Walter Budwing (Josh Hutcherson) and his younger brother, Danny (Jonah Bobo), figure they''re going to be in for a boring time when their father (Tim Robbins), who was supposed to spend the day with them, is suddenly called away on business, and gives them strict orders not to leave the house. Walter, who doesn''t have much use for Danny, is motivated by boredom more than anything else when he agrees to play a board game Danny has found in the basement during a round of hide-and-seek. However, the boys quickly discover the space-themed game Zathura has some unusual qualities -- a roll of the dice unexpectedly launches the Budwing home into outer space, and Walter and Danny are suddenly fending off menacing robots, angry aliens, and showers of interstellar debris outside the Earth''s atmosphere. As the boys try to figure out a way back home, they get some unexpected help from an ...', 'Action, Adventure, Comedy, Family, Fantasy, Sci-Fi', 'USA', 'PG', '6.2', 'Jon Favreau', '[{"id":"nm0269463","name":"Jon Favreau"}]', 'Josh Hutcherson, Jonah Bobo, Dax Shepard, Tim Robbins', '[{"id":"nm1501050","image":"https://imdb-api.com/images/original/MV5BMTMyMTkwNjk5Nl5BMl5BanBnXkFtZTcwNDE0MDIwNg@@._V1_Ratio0.8636_AL_.jpg","name":"Jonah Bobo","asCharacter":"Danny"},{"id":"nm1242688","image":"https://imdb-api.com/images/original/MV5BMTI4OTk0MjQ1OV5BMl5BanBnXkFtZTcwNTE3NjM3Mw@@._V1_Ratio0.7273_AL_.jpg","name":"Josh Hutcherson","asCharacter":"Walter"},{"id":"nm10